import React from 'react'
import '../styles/card.css'

export default function Navbar() {
  return (
    <div className="navbar" id="navbar">
        <h1>BotBracket</h1>
        <ul>
            <a href="#navbar"><li>Home</li></a>
            <a href='#courses'><li>Tournaments</li></a>
            {/* <Link to="/links"><li>Links</li></Link> */}
            <a href='#bracket'><li>Bracket</li></a>
        </ul>
        {/* <i className="material-icons" id="burger">menu</i> */}
    </div>
  )
}
